import React from 'react';

function Email(props) {
  return (
  	<div className="card-box">
      <div className="email-card-header">
        <div className="email-card-author"><p>Михайлова А.В.</p></div>
        <div className="email-card-status"></div>
        <div className="email-card-time"><p>19 июн 2019, 10:49:44</p></div>
      </div>
      <div className="email-card-header">
        <h3>О критериях оценки питча</h3>
      </div>
      <div className="events-card-content">
        <p>В ЛМС, в папке "Материалы" доступна презентация семинара №9 с критериями оценки питча. С Уважением, Алёшина Т.А. менеджер кафедры менеджмента инноваций НИУ ВШЭ</p>
      </div>
    </div>
  );
}

export default Email;
